  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Petit
  Manan NWR, Cross Island NWR, Seal Island NWR, and Franklin Island NWR outlines Refuge
  accomplishments during the 1989 calendar year. The report begins with a summary
  of the year's highlights and weather conditions. Land acquisition is covered. The
  report includes a planning section which discusses management planning and research
  and investigations. Refuge administration is outlined; information about personnel,
  volunteer programs, funding, safety, and technical assistance is given. Habitat
  management is also covered; subjects include wetlands, forests, grasslands, grazing,
  haying, fire management, and wilderness areas. The wildlife section of the report
  discusses wildlife diversity, endangered and threatened species, waterfowl, shorebirds,
  raptors, game mammals, marine mammals, scientific collections, animal control, marking
  and bird banding, and disease control. The public uses of the Refuge described in
  this report include interpretive programs and law enforcement. The equipment and
  facilities section of the report provides information about new construction, rehabilitation,
  major maintenance, equipment replacement, and computer systems. Items of interest
  are provided at the end. Field guides are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
